import React from "react";
import {
  AppBar,
  Toolbar,
  ListItem,
  IconButton,
  ListItemText,
  Avatar,
  Divider,
  List,
  Typography,
  Box,
  Backdrop,
} from "@material-ui/core";
import {
  ArrowBack,
  AssignmentInd,
  Home,
  Apps,
  ContactMail,
} from "@material-ui/icons";

const Navbar = () => {
  return (
    <Box component="nav">
      <AppBar position="static" style={{background: "#222"}}>
        <Toolbar>
          <IconButton>
            <ArrowBack style={{ color: "tomato"}}/>
          </IconButton>
          <Typography variant="h5">

          </Typography>
        </Toolbar>
      </AppBar>
    </Box>
  );
};

export default Navbar;
